import React from 'react'
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { Homepage, Login, Post, AllPosts, NewPost,} from './components/index'; 
import './style.css'
import './components/styled/post.css'


const App = () => {
    return (
        <div>
            <Router>
                {/* Navbar */}
                <nav>
                    <Link to="/login">Login</Link>

                    <Link to="/allposts">In Your Area</Link>
                    <Link to="/home">Home Page</Link>
                    <Link to="/addpost"> add ur post</Link>
                </nav>
                {/* Main Content Section */}
                <Routes>
                    <Route path="/" element={<Homepage />} />
                    <Route path="/home" element={<Homepage />} />
                    <Route path="/home" element={<AllPosts />} />
                    <Route path="/login" element={<Login />} />
                    <Route path="/allposts" element={<Post />} />
                    <Route path="/addpost" element={<NewPost />} />

               </Routes>
               {/*foot*/}
               <element class='footer'>
               </element>            
            </Router>
        </div>
    )
};

// React v18
const appElement = document.getElementById('app');
const root = ReactDOM.createRoot(appElement);
root.render(<App />)
